import { IonPage, IonHeader, IonToolbar, IonButtons, IonBackButton, IonTitle, IonContent, IonButton, IonIcon } from "@ionic/react";
import React from "react";
import { chevronBack, ellipsisVerticalOutline } from "ionicons/icons";
import './AlphabeticalIndex.css';

const AlphabticalIndex: React.FC = () => {
    return (

        <IonPage id="AlphabeticalIndexes">
      <IonHeader>
        <IonToolbar>
          <IonButtons  slot="start">
          <IonBackButton defaultHref=".." icon={chevronBack} />
        </IonButtons>
          <IonTitle>Alphabetical Index</IonTitle>
          <IonButtons  slot="end">
          <IonButton >
            <IonIcon slot="icon-only" icon={ellipsisVerticalOutline}/>
          </IonButton>
        </IonButtons>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
      </IonContent>
    </IonPage>
    );
};
export default AlphabticalIndex;
